alter session set nls_date_format='YYYYMMDD';

DECLARE
i NUMBER :=15;
a varchar2(20);
b varchar2(20);
begin
loop
 select sysdate+i into a from dual;
 select sysdate+i+1 into b from dual;
 dbms_output.put_line('ALTER TABLE FRAUDSTAR.AUTHORIZATIONS ADD PARTITION P'||a||' VALUES LESS THAN  (TO_DATE('' '||substr(b,1,4)||'-'||substr(b,5,2)||'-'||substr(b,7,2)||' 00:00:00'', ''SYYYY-MM-DD HH24:MI:SS'', ''NLS_CALENDAR=GREGORIAN'')) TABLESPACE AUTH_10'|| SUBSTR(a,5,2)||' ;');
 i:=i+1;
 exit when i>380;
 end loop;
end;



select 'ALTER USER FRAUDSTAR QUOTA UNLIMITED ON '||tablespace_name||';' from dba_tablespaces where tablespace_name like '%10%';



