declare
cursor c1 is select ip.index_owner,ip.index_name,ip.partition_name from dba_ind_partitions ip ,dba_part_indexes pi 
where 
ip.INDEX_NAME = pi.INDEX_NAME
and ip.INDEX_OWNER = pi.OWNER
and ip.partition_name like 'P2010%' and ip.tablespace_name = 'FS_INDX_NEW'
and pi.TABLE_NAME = 'TRANSACTIONS';
begin       
       FOR STR in c1
          LOOP
                dbms_output.put_line ('ALTER index '||str.index_owner||'.'||str.index_name||' rebuild partition '||str.partition_name||' TABLESPACE AUTH_LOG_10'||substr(str.partition_name,6,2)||';');
          END LOOP;
